import tel from "../../../assets/icons/icon_tel.svg"
import address from "../../../assets/icons/icon_address.svg"
import daily from "../../../assets/icons/icon_daily.svg"

const contactData = [
    {
        img: tel,
        title: "Call Us",
        description: "+1 (213) 555-0198",
    },
    {
        img: address,
        title: "Visit Us",
        description: "143 Grand Ave, LA, CA",
    },
    {
        img: daily,
        title: "Our Hours",
        description: "Daily: 9AM–6PM",
    }
]
export default contactData;
